import React from "react";

const App =()=>{
  return(
    <>
    <div>
      <nav>
        <div className="nav-logo">
          <img src="./brand_logo.png" alt="logo"></img>
        </div>
        <ul>
          <li>MENU</li>
        </ul>
      </nav>
    </div>
    </>
  );
}

export default App;
